import React from 'react';
import logo from './logo.svg';
import './App.css';
import Greet from './Components/Greet';
import Person from './Components/Person';
import PersonList from './Components/PersonList';

function App() {
  const personInfo = {
    firstName: 'Smith',
    lastName: 'Blake'
  }

  const nameList = [
    {
      firstName: 'Smith',
      lastName: 'Blake'
    },
    {
      firstName: 'Perry',
      lastName: 'Cooper'
    },
    {
      firstName: 'Rebeccah',
      lastName: 'Tyles'
    },
    {
      firstName: 'Lesley',
      lastName: 'Paynes'
    }
  ]
  return (
    <div className="App">
      <Greet firstName="Presley" messageCount={20} isLoggedIn={true}></Greet>
      <Person userInfo={personInfo}></Person>
      <PersonList ></PersonList>

    </div>
  );
}

export default App;
